import React from "react";
import Slider from "react-slick";

const Banner = () => {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
      };
  return (
    <div className="banner-container container">
      <Slider {...settings}>

        <div className="banner">
          <img
            src="https://samcenter.vn/images/uploaded/banner/2024/thang_6/tongdpc.png"
            alt=""
          />

        {/* Thêm các slide khác ở đây nếu cần */}
      </div>
    </Slider>
      <div className="banner_2">
        <div className="banner_top">
          <img
            src="https://samcenter.vn/images/uploaded/banner/2024/thang_6/tab%20s9%20tow.png"
            alt=""
          />
        </div>
        <div className="banner_down">
          <img
            src="https://samcenter.vn/images/uploaded/banner/2024/thang_6/w6pc.png"
            alt=""
          />
        </div>
      </div>
    </div>
  );
};

export default Banner;
